import React from 'react';
import './Logo.css'; 
import logoImg from '../public/logo.svg'; 

function Logo() {
  return (
    <div className="logo-container">
      <img src={logoImg} alt="Logo" className="logo-img" />
    </div>
  );
}

export default Logo;
